import React from "react"

export const Login_Logout_Btn = () => {

    return <React.Fragment>

        <div
        style={{
            display:'flex',
            flexDirection: 'row',
            justifyContent: 'end'
        }}
        >

        <div
        style={{
            backgroundColor: 'white',
            padding: '1vh 1vw'
        }}
        >
            Login
        </div>

        </div>

    </React.Fragment>

}

export default Login_Logout_Btn;
